            `,url:"https://johnson7788.github.io/2022/07/04/%E6%BB%A1%E6%84%8F%E5%BA%A6%E9%A2%84%E6%B5%8B%E6%A8%A1%E5%9E%8B/",language:"python label-studio",types:"品牌识别"},{title:"化妆品领域知识图谱构建及应用",description:`
            本项目的主要目标是在化妆品领域中构建知识图谱，该图谱包含了各种商品、品牌、属性之间的关系，并将其应用于问答任务中。主要步骤如下：
            数据来源：我们的数据来自各种渠道，包括结构化数据源（如数据库和Excel表格）以及非结构化数据源（如pipeline方法抽取的实体关系）。
            本体设计：我们的知识图谱包括25类实体（约3万个实体）和18种关系（约59万个关系）。节点属性包括商品名称、规格、价格、功效等，而关系则包括商品和品牌的关系、商品和功效的关系等。
            我们已将这个知识图谱成功应用于基于模板规则的问答任务中。
            `,url:"https://johnson7788.github.io/2022/03/15/neo4j的构建的知识图谱的语法示例",language:"neo4j",types:"知识图谱"},{title:"高并发文件识别分类系统（支持同步与异步处理）",description:`
            本项目开发了一个具有高并发性能的系统，以处理用户上传的文档或压缩文件。使用flask框架，并结合Res2Net，TextCNN，OCR，distilbert等技术进行文件识别和分类。
            用户上传文档或压缩文件后，系统首先对这些文件进行内容提取。
            接着，系统使用distilbert进行NER识别，并用TextCNN对文档内容进行分类。
            对上传的图片文件，系统会进行OCR识别，然后对识别出的内容进行纠错和分类。
            最后，系统会根据接口规范将处理结果返回给用户。
            `,url:"https://github.com/johnson7788/NLP/tree/master/%E5%BC%82%E6%AD%A5%E6%B5%8B%E8%AF%95",language:"asyncio",types:"Flask"},{title:"多功能快速应用集成项目",description:`
